/* styles */
import style from './index.scss';


const NavModule = ({ url, name }) => {
    return (
        <div className={style.root}>
            <a href={url}>{name}</a>
            {navModuleData ? <NavModule name={navModuleData.Group[1].name} url={navModuleData.Group[1].url.url} /> : null}
        </div>
    );
};

export default NavModule;
